import { gql } from "@apollo/client";

export function fetchFirstPage (title:String) {
  return gql`
  query getBookId {
    allBooks{
      nodes{
        id
        title
      }
    }
  }
`;
}


export const FETCH_FIRST_PAGE = gql `
  query test3($id: Int!) {
    bookById(id: $id){
      pagesByBookId{
        nodes{
          pagenum
          content
        }
      }
    }
  }
`;
